            firtsName = "Erick"
            JobTittle = "Frontend Developer"
            twitter = "ErickRV19" /
            >
            <
            /div> <
            div className = "col-6" >
            <
            BadgeForm / >
            <
            /div> < /
            div > <
            /div> < /
            div >
        );
    }
}

export default BadgeNew;
